import axios from 'axios';


export const traerDatos = (user) => async (dispacth) => {   
    dispacth({
        type: 'cargando'
    })
    const respuesta = await instance.get('https://bio.torre.co/api/bios/' + user);    
    
    dispacth({
        type: 'traer_datos',
        payload: respuesta.data
    })
}

